update  ca
SET 
    ca.ID_REGIMEN_LABORAL=  c.ID_REGIMEN_LABORAL,
    ca.CODIGO_CARGO=  c.CODIGO_CARGO,
	ca.DESCRIPCION_CARGO=  c.DESCRIPCION_CARGO,
	ca.ABREVIATURA_CARGO=  c.ABREVIATURA_CARGO,
	ca.ACTIVO=  c.ACTIVO,
	ca.FECHA_MODIFICACION=GETDATE(),
	ca.USUARIO_CREACION='MIGRA'
from cargo_temp  c inner join cargo ca  on c.ID_CARGO=ca.ID_CARGO

